function getDispatchReport(){$.ajax({type:"GET",url:"/report/getDispatchReport",data:{},success:s=>{let a=$("#DispatchReportModal");a.modal("show");const d=a.find("tbody");d.empty();for(var i=0;i<s.length;i++)d.append(`<tr id="${s[i].id}" class="reports"><td>${s[i].dispatch.name}</td><td>${s[i].date}</td></tr>`);$(".reports").click((function(){let s=$(this).attr("id");console.log(s);$("#DispatchReportModal");$.ajax({type:"GET",url:"/report/showDispatchReportById/"+s,data:{name:$("params.name").val(),date:$("params.date").val(),hours:$("params.hours").val(),active_loads:$("params.active_loads").val(),active_drivers:$("params.active_drivers").val(),inactive_drivers:$("params.inactive_drivers").val(),loads_finalized:$("params.loads_finalized").val(),worked_time:$("params.worked_time").val(),dispatch_score:$("params.dispatch_score").val(),score_app_usage:$("params.score_app_usage").val(),well_status:$("params.well_status").val(),description:$("params.description").val()},success:s=>{let a=$("#showDispatchReport");a.modal("show");const d=a.find(".modal-body");d.empty(),d.empty(),d.append(`<div class="form-group"><div class="row"><div class="col-md-3">Dispatch Name:</div> <div class="col-md-3">${s.name}</div><div class="col-md-3">Date:</div><div class="col-md-3">${s.date}</div></div><br><div class="row"><div class="col-md-3">Hour:</div><div class="col-md-3">${s.hours}</div><div class="col-md-3">In Transit:</div><div class="col-md-3">${s.active_loads}</div></div><br><div class="row"><div class="col-md-3">Active Truck:</div><div class="col-md-3">${s.active_drivers}</div><div class="col-md-3">Inactive Truck:</div><div class="col-md-3">${s.inactive_drivers}</div></div><br><div class="row"><div class="col-md-3">Time in Dispatch:</div><div class="col-md-3">${msToTime(1e3*s.worked_time*60,!1)}</div><div class="col-md-3">Loads Dispatch:</div><div class="col-md-3">${s.loads_finalized}</div></div><br><div class="row"><div class="col-md-3">App Usage Score</div><div class="col-md-3">${s.score_app_usage}</div><div class="col-md-3">Dispatch Score</div><div class="col-md-3">${s.dispatch_score}</div></div><br><div class="row"><div class="col-md-3">Well Status</div><div class="col-md-9">${s.well_status}</div><div class="col-md-3">Description</div><div class="col-md-9">${s.description}</div></div><br>`)},error:()=>{throwErrorMsg()}})}))},error:()=>{throwErrorMsg()}})}
